ISIONS ///\n          ---\n          CHARGE APPLY PER TRANSACTION.\n          CHILD DISCOUNT APPLY.\n          INFANT WITHOUN A SEAT FREE OF CHARGE.\n          ---\n          CHANGE IS A ROUTING/DATE/FLIGHT/BOOKING CLASS/FARE\n          MODIFICATION.\n          ---\n          RULES FOR CHANGES APPLY BY FARE\n          COMPONENT/DIRECTION.\n          IN CASE OF COMBINATION CHARGE THE HIGHEST FEE OF\n          ALL CHANGED FARE COMPONENTS.\n          ---\n          WHENEVER A NONREFUNDABLE FARE TICKET IS REISSUED\n          A NONREFUNDABLE NOTATION MUST BE MADE IN THE\n          ENDORSEMENT BOX OF THE NEW TICKET.\n          THE ORIGINAL NONREFUNDABLE VALUE REMAINS\n          NONREFUNDABLE FOR ANY SUBSEQUENT REISSUES.\n          ---\n          CHANGES ARE NOT PERMITTED AFTER THE DEPARTURE\n          TIME SHOWN ON THE APPLICABLE FLIGHT COUPON /INCL\n          NO-SHOW/.\n          IN THIS CASE TICKET HAS NO VALUE.\n          EXCEPTION - FARE RULES WHICH ALLOW TO MAKE\n          CHANGES ANY TIME INCLUDING FOR NO-SHOW.\n</pre>\n  </div>\n</div>',personsIDs:["0000-5d965a56-7db7-43b9-9937-7628c11cf2ba","0000-37c2ca33-570c-4b52-bbfc-af9ccb540a6c"]},{id:"0000-117e9abd-92ab-4b18-834a-9b252233c250",personCategory:{id:"CHILD",type:"personCategory"},code:"NLPXRF/CH25",info:'<div class="uptBlock">\n  <div class="uptFareCode">Код тарифа: NLPXRF/CH25</div>\n  <div class="uptCategory">\n    <div class="uptCategoryHeader">16. PENALTIES</div>\n    <pre class="uptCategoryParagraph">   FARE RULE\n   CANCELLATIONS\n   \n     ANY TIME\n       TICKET IS NON-REFUNDABLE IN CASE OF CANCEL/NO-SHOW/\n   REFUND.\n   \n   CHANGES\n   \n     ANY TIME\n       CHARGE RUB 2500 FOR REISSUE/REVALIDATION.\n   \n   CHANGES NOT PERMITTED IN CASE OF NO-SHOW.\n         NOTE - TEXT BELOW NOT VALIDATED FOR AUTOPRICING.\n          ---                ///\n          // CHANGES BEFORE OUTBOUND DEPARTURE //\n                             ///\n          1.WHEN THE FIRST FARE COMPONENT IS CHANGED -\n          THE ENTIRE